#include <iostream>
#include <string>

using namespace std;

int main(){
	string input = "";

	for (size_t i = 0; i < input.size(); ++i){
		if (i % 96 == 0) cout << endl;
		cout << input[i];
	}
	cout << endl;
	cout << endl;
	
	string first;
	string second;
	string third;
	string fourth;
	string fifth;
	string sixth;
	
	
	for (size_t j = 0; j < 96; ++j){
		if (j % 32 == 0){
			cout << first;
			cout << second;
			cout << third;
			cout << fourth;
			cout << fifth;
			cout << sixth;
			cout << endl;
			first = "";
			second = "";
			third = "";
			fourth = "";
			fifth = "";
			sixth = "";
		
		}
		for(size_t i = 0; i < 96; ++i){
			if (i < 16){
				first += input[i + j*96];
			}
			else if (i < 32){
				second += input[i + j*96];
			}
			else if (i < 48){
				third += input[i + j*96];
			}
			else if (i < 64){
				fourth += input[i + j*96];
			}
			else if (i < 80){
				fifth += input[i + j*96];
			}
			else{
				sixth += input[i + j*96];
			}
		}
	}
	cout << first;
	cout << second;
	cout << third;
	cout << fourth;
	cout << fifth;
	cout << sixth;

	return 0;
}
